gRm(){return"My name is Bruno Marchi Pires, I'm 24 years old and currently live in Florian\xf3polis. I have a degree in Computer Science from the State University of Santa Catarina (UDESC). Here, in my portfolio, you will be able to better understand my academic and professional trajectory, learn about the projects I have worked on, as well as my ambitions and future goals. I'm always open to communication and you can contact me through any of the channels available here!"},
gIG(){return"I have always had a great affinity with computers and ease with logical reasoning, which led me to enroll in the Computer Science bachelor's degree in 2018. Even without prior programming experience, the academic environment proved to be highly stimulating and challenging, providing broad and in-depth learning in various areas. During my academic journey, I acquired a solid foundation in programming with the C language and evolved to object orientation with Java. From there, I explored various areas, including data analysis, evolutionary algorithms, artificial intelligence and game development with Python. I also had contact with functional languages like Haskell, in addition to exploring Web development frameworks like Angular and React. I used some relational and non-relational databases, such as MySQL, PostgreSQL and MongoDB, beyond all the scope that is inherent to a good computer science course. Currently, I dedicate myself to developing mobile solutions with Dart and Flutter. I have always sought to maintain a broad and versatile view in the technology area, testing new frameworks and languages, believing that this facilitates continuous learning of new technologies and avoids exclusive dependence on a single language or framework in building effective solutions."},
gRT(){return"Junior Mobile Software Developer"},
gRR(){return"I worked on the development of two white label applications marketed to hundreds of clients, participating in the entire development and maintenance cycle.\n\nMain activities:\n\u2022 Development with clean architecture, structured in layers (Data, Domain, Presentation).\n\u2022 Identification and correction of bugs in development and production environments.\n\u2022 Active participation in agile methodologies: refinements, code reviews, dailies and retrospectives.\n\u2022 Management of multiple applications in Google Play and App Store stores (white label model).\n\u2022 Contribution to technical discussions and decision-making about architecture and development patterns.\n\nTechnical responsibilities:\n\u2022 Use of different state managers, such as GetX and Provider.\n\u2022 Implementation of clean architecture (contracts, use cases, services, repositories, DTOs and models).\n\u2022 Creation and configuration of applications in Firebase.\n\u2022 Integration with native operating system resources (e.g.: camera).\n\u2022 Firebase Push Notifications configuration.\n\u2022 Writing unit tests.\n\u2022 Use of pipelines for partner publication in stores and maintenance of the same.\n\u2022 Creation of scripts for automation of manual team processes."},
