gWp(){return"In the context of a team focused on the international market, I played a significant role in customizing and creating software to meet the specific needs of corporate clients for the international market. As the team's main developer in the context of Web technologies, I worked on a large-scale project focused on technological modernization, which consisted of transforming traditional desktop programs into sophisticated web applications adapted for the international market.\n\nDuring this period, I substantially improved my skills in using Angular and AngularJS frameworks, applying programming languages such as TypeScript and HTML to develop robust and efficient solutions.\n\nMy experience also included API development using the Progress4GL language, which facilitated the integration of databases into the new web environment efficiently. Additionally, I had the opportunity to explore PO-UI, a proprietary graphical interface framework from the company, which is also made available for public use.\n\nThis set of skills and experiences not only enriched my technical repertoire, but also enabled a significant contribution to innovation in a large organization, highlighting the relevance and impact of my work."},
